ell {\n  border: 1px solid #db3d3a;\n  padding: 4px;\n  margin-right: 25px;\n  border-radius: 5px;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .buy .tp_neutral {\n  border: 1px solid #f58c64;\n  padding: 4px;\n  margin-right: 25px;\n  border-radius: 5px;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .flag {\n  color: var(--theme-dark-bg-text);\n  font-size: 15px;\n  font-weight: 600;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .flag img {\n  width: 20px;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .flag .avatar {\n  width: 20px;\n  height: 20px;\n  background: #1f6f22;\n  color: #fff;\n  font-size: 13px;\n  font-weight: 400;\n  margin-right: 6px;\n  font-family: \"Play\";\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .flag .mat-icon-button, #autotrade .col-bx1 .signal-tab .tab-content .signal-bx .flag span {\n  color: var(--theme-text);\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .stratergy {\n  color: #db3d3a;\n  font-size: 15px;\n  font-weight: 600;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .signal-bx1 {\n  width: 33.33%;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .signal-bx1 h5 {\n  color: #9f9f9f;\n  font-size: 15px;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .signal-bx1 span {\n  border-radius: 20px;\n  padding: 4px 10px;\n  font-size: 13px;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .signal-bx .unlock-signalbtn {\n  background: rgba(30, 112, 39, 0.1);\n  color: #1e7027;\n  border-radius: 10px;\n  padding: 10px 20px;\n  font-size: 15px;\n}\n#autotrade .col-bx1 .signal-tab .tab-content .sbmt-btn {\n  background: #030303;\n  padding: 10px 30px;\n  border-radius: 10px;\n  font-weight: 600;\n  margin-bottom: 30px;\n}\n#autotrade .col-bx1 .signal-popup {\n  background: rgba(0, 0, 0, 0.5);\n  z-index: 3;\n  animation: 0.3s show-popup;\n}\n#autotrade .col-bx1 .signal-popup .signal-popup-bx {\n  background: var(--theme-ba