                  mode="BUY";
                } else if(ENT < STOP){
                  mode="SELL";
                }
               data.signals[z].signalActual.mode = mode;

               let currRate=<any>0;
               let symbolName=(data.signals[z].signalActual.symbol).replace(".","").replace("&","").replace("#","");					    		
               data.signals[z].signalActual.symbolName = symbolName;
                    
               add_pen=add_pen+1;
               // console.log(add_pen);

               let class_val2 = "";
               if((add_pen%2)==0){
                   class_val2="tab-dark";
